def solve(n):
    sum_of_cubes = 0
    sum_of_numbers = 0
    for i in range(1,n+1):
        sum_of_cubes += (i**3)
        sum_of_numbers += i
    return sum_of_cubes - (sum_of_numbers**2)

def solve(n):
    sum_natural = (n*(n+1))/2
    sum_cubes = (n*(n+1)*(2*n+1))/6
    return (sum_cubes - sum_natural)
